import React from "react";
import {Input, Modal} from "antd";

const AddCoding = ({isOpen,handleOk,handleCancel}) =>
{    
    return (
      <Modal visible={true}
             title="Add New ICD10 / Tariff Code"
             closable={isOpen} 
             onOk={handleOk}
             onCancel={handleCancel}              
             style={{zIndex: 2600}}>
        <div className="gx-form-group">       
        <Input
            placeholder="Enter ICD10 Code"
            margin="normal"
          />
        </div>
        <div className="gx-form-group">
        <Input.TextArea />
        </div> 
      </Modal>
    );
  }
export default AddCoding;
